    "summary": "Cranberry Crumb Bars is a <b>vegetarian</b> hor d'oeuvre. For <b>29 cents per serving</b>, this recipe <b>covers 3%</b> of your daily requirements of vitamins and minerals. This recipe makes 24 servings with <b>163 calories</b>, <b>2g of protein</b>, and <b>9g of fat</b> each. 18 people have tried and liked this recipe. If you have cranberries, cornstarch, sugar, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 16%</b>. This score is not so tremendous. Similar recipes include <a href=\"https://spoonacular.com/recipes/cranberry-crumb-bars-178779\">Cranberry Crumb Bars</a>, <a href=\"https://spoonacular.com/recipes/cranberry-crumb-bars-571362\">Cranberry Crumb Bars</a>, and <a href=\"https://spoonacular.com/recipes/cranberry-crumb-bars-585182\">Cranberry Crumb Bars</a>.",
