    "summary": "You can never have too many sauce recipes, so give Authentic Bolognese Sauce a try. This recipe makes 8 servings with <b>476 calories</b>, <b>23g of protein</b>, and <b>35g of fat</b> each. For <b>$2.31 per serving</b>, this recipe <b>covers 16%</b> of your daily requirements of vitamins and minerals. 6 people have made this recipe and would make it again. If you have milk, regular ground beef, pancetta, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. It is a good option if you're following a <b>gluten free, primal, and ketogenic</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 50%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/rag-alla-bolognese-bolognese-sauce-481414\">Ragù alla bolognese (Bolognese Sauce)</a>, <a href=\"https://spoonacular.com/recipes/bolognese-sauce-ragu-bolognese-12250\">Bolognese Sauce (ragu Bolognese)</a>, and <a href=\"https://spoonacular.com/recipes/the-best-authentic-enchilada-sauce-144428\">The Best Authentic Enchilada Sauce</a> for similar recipes.",
