    "summary": "The recipe Strawberry and Nutella Cobbler could satisfy your Southern craving in roughly <b>45 minutes</b>. This recipe makes 3 servings with <b>664 calories</b>, <b>7g of protein</b>, and <b>26g of fat</b> each. For <b>$1.79 per serving</b>, this recipe <b>covers 17%</b> of your daily requirements of vitamins and minerals. It can be enjoyed any time, but it is especially good for <b>Mother's Day</b>. 435 people were impressed by this recipe. Head to the store and pick up baking powder, cornstarch, salt, and a few other things to make it today. Several people really liked this dessert. It is a good option if you're following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 67%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/strawberry-nutella-cheesecake-610461\">Strawberry Nutella Cheesecake</a>, <a href=\"https://spoonacular.com/recipes/strawberry-nutella-poptarts-583757\">Strawberry Nutella Poptarts</a>, and <a href=\"https://spoonacular.com/recipes/strawberry-nutella-muffins-547678\">Strawberry Nutella Muffins</a> for similar recipes.",
