    "instructions": "Preheat oven to 400 degrees.Combine strawberries, nutella, cornstarch, sugar, and vanilla in a mixing bowl until strawberries are evenly coated.Pour mixture into a 9 inch round pie pan.In another mixing bowl, whisk together flour, sugar, baking powder, and salt.Slowly add the cream and whisk until just combined.Roll out the mixture onto a non stick baking mat and knead one or two times to combine.Grab a handful of dough (approx 3 tbsp.) and roll into a ball and then gently flatten.Lay biscuits over the strawberry mixture, having them slightly overlap. These do not have to be perfect.Spread a small amount of left over cream over the biscuits and then sprinkle with a small amount of sugar.Bake for 20-25 minutes or until biscuits are golden brown and the strawberries are bubbling.Let cool for at least half an hour so that the strawberry juices can firm back up.Serve warm with whipped cream or ice cream!",
