    "summary": "Bacalhau Macau might be just the main course you are searching for. This recipe makes 4 servings with <b>504 calories</b>, <b>44g of protein</b>, and <b>19g of fat</b> each. For <b>$2.03 per serving</b>, this recipe <b>covers 31%</b> of your daily requirements of vitamins and minerals. 9 people were impressed by this recipe. It is a good option if you're following a <b>pescatarian</b> diet. A mixture of japanese breadcrumbs, ginger, cilantro, and a handful of other ingredients are all it takes to make this recipe so yummy. To use up the egg you could follow this main course with the <a href=\"https://spoonacular.com/recipes/rose-levy-beranbaums-chocolate-tomato-cake-with-mystery-ganache-27408\">Rose Levy Beranbaum's Chocolate Tomato Cake with Mystery Ganache</a> as a dessert. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 77%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/lechon-kawali-stew-aka-lechon-macau-520873\">Lechon kawali stew (a.k.a. Lechon Macau)</a>, <a href=\"https://spoonacular.com/recipes/bacalhau-a-braz-2333\">Bacalhau A Braz</a>, and <a href=\"https://spoonacular.com/recipes/bacalao-bacalhau-chowder-521680\">Bacalao (Bacalhau) chowder</a> for similar recipes.",
