    "summary": "Turkey and Rice Stuffed Acorn Squash is a main course that serves 6. Watching your figure? This dairy free recipe has <b>413 calories</b>, <b>29g of protein</b>, and <b>10g of fat</b> per serving. For <b>$2.82 per serving</b>, this recipe <b>covers 37%</b> of your daily requirements of vitamins and minerals. A couple people made this recipe, and 35 would say it hit the spot. Head to the store and pick up vegeta seasoning, baby bella mushrooms, salt and pepper, and a few other things to make it today. It is brought to you by Foodista. From preparation to the plate, this recipe takes about <b>about 45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 93%</b>. This score is awesome. Try <a href=\"https://spoonacular.com/recipes/butternut-squash-noodle-turkey-bolognese-stuffed-acorn-squash-with-melted-gruyere-two-ways-563828\">Butternut Squash Noodle Turkey Bolognese Stuffed Acorn Squash with Melted Gruyere: Two Ways</a>, <a href=\"https://spoonacular.com/recipes/turkey-sausage-stuffed-acorn-squash-837847\">Turkey Sausage-Stuffed Acorn Squash</a>, and <a href=\"https://spoonacular.com/recipes/turkey-chili-stuffed-acorn-squash-934987\">Turkey Chili Stuffed Acorn Squash</a> for similar recipes.",
