    "summary": "Holiday Egg Nog might be a good recipe to expand your beverage repertoire. One serving contains <b>437 calories</b>, <b>8g of protein</b>, and <b>31g of fat</b>. This gluten free and lacto ovo vegetarian recipe serves 4 and costs <b>80 cents per serving</b>. This recipe from Foodista requires allspice, milk, sugar, and heavy cream. It is perfect for <b>Christmas</b>. 12 people found this recipe to be tasty and satisfying. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 74%</b>. This score is solid. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/sugar-free-holiday-nog-139874\">Sugar-Free Holiday Nog</a>, <a href=\"https://spoonacular.com/recipes/holiday-nog-light-cider-eggnog-487675\">Holiday Nog {Light Cider Eggnog}</a>, and <a href=\"https://spoonacular.com/recipes/califia-farms-holiday-nog-pancakes-587556\">Califia Farms Holiday Nog Pancakes</a>.",
