    "instructions": "<ol><li>Add the egg yolks and sugar to your mixer. Whip it up good until the mixture turns a light yellow color.</li><li>Now, grab your small saucepan and add to it the milk, heavy cream, allspice, nutmeg, and cinnamon.</li><li>Heat it up to just boiling and remove it from the heat. Grab about a half a cup of the hot milk and add it into the egg mixture, whisking constantly. Now add the tempered egg mixture back into the rest of your milk mixture, continuing to whisk constantly.</li><li>Put the mixture back on medium low heat and cook it until just boiling and thickened.</li><li>Pop it into a container and set it in the fridge to cool completely.</li></ol>",
