    "imageType": "jpg",
    "summary": "Swiss Chard and Mushroom Popover Bake might be just the side dish you are searching for. This recipe makes 4 servings with <b>258 calories</b>, <b>13g of protein</b>, and <b>17g of fat</b> each. For <b>93 cents per serving</b>, this recipe <b>covers 18%</b> of your daily requirements of vitamins and minerals. It is a good option if you're following a <b>gluten free</b> diet. 10 people have tried and liked this recipe. If you have garlic clove, olive oil, provolone cheese, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 67%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/swiss-chard-and-mushroom-popover-bake-20204\">Swiss Chard And Mushroom Popover Bake</a>, <a href=\"https://spoonacular.com/recipes/quiche-with-swiss-chard-and-mushroom-657511\">Quiche with Swiss Chard and Mushroom</a>, and <a href=\"https://spoonacular.com/recipes/swiss-chard-and-mushroom-squares-20369\">Swiss Chard And Mushroom Squares</a> for similar recipes.",
