    "summary": "Bacon Brownie Cupcakes takes around <b>around 45 minutes</b> from beginning to end. This recipe serves 6 and costs $1.07 per serving. One serving contains <b>511 calories</b>, <b>11g of protein</b>, and <b>37g of fat</b>. If you have eggs, , chocolate, and a few other ingredients on hand, you can make it. 33 people were glad they tried this recipe. It is brought to you by Foodista. A few people really liked this American dish. All things considered, we decided this recipe <b>deserves a spoonacular score of 42%</b>. This score is pretty good. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/bacon-nutella-brownie-bites-with-maple-cinnamon-bacon-glaze-628501\">Bacon Nutella Brownie Bites with Maple Cinnamon Bacon Glaze</a>, <a href=\"https://spoonacular.com/recipes/brownie-cupcakes-380205\">Brownie Cupcakes</a>, and <a href=\"https://spoonacular.com/recipes/brownie-cupcakes-63450\">Brownie Cupcakes</a>.",
