    "summary": "You can never have too many main course recipes, so give Gluten Free Fruit Stuffed Turkey Breast with Hibiscus Sauce a try. This recipe makes 4 servings with <b>472 calories</b>, <b>47g of protein</b>, and <b>11g of fat</b> each. For <b>$4.29 per serving</b>, this recipe <b>covers 31%</b> of your daily requirements of vitamins and minerals. If you have salt, pineapple, sugar, and a few other ingredients on hand, you can make it. To use up the salt you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-turnovers-recipe-48175\">Apple Turnovers Recipe</a> as a dessert. It is a good option if you're following a <b>gluten free</b> diet. From preparation to the plate, this recipe takes around <b>45 minutes</b>. 8 people were impressed by this recipe. All things considered, we decided this recipe <b>deserves a spoonacular score of 79%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/gluten-free-roast-turkey-breast-and-avocado-cream-on-a-bed-of-g-21275\">Gluten-free Roast Turkey Breast And Avocado Cream On A Bed Of G</a>, <a href=\"https://spoonacular.com/recipes/porcini-sage-roasted-turkey-breast-low-carb-gluten-free-691791\">Porcini & Sage Roasted Turkey Breast – Low Carb & Gluten Free</a>, and <a href=\"https://spoonacular.com/recipes/fig-and-stilton-stuffed-turkey-breast-with-port-sauce-75619\">Fig and Stilton-Stuffed Turkey Breast with Port Sauce</a> for similar recipes.",
