    "instructions": "<ol><li>For the Turkey:</li><li>Method: Preheat oven to 350 degrees.  Slit a pocket laterally in the turkey breast. Julienne the dried fruit and the spinach and mix in a bowl with the chopped shallot. Stuff the mixture into the turkey breast and season with salt and pepper, coat with the melted butter and wrap in sheet of foil. Heat a large skillet until it is very hot and place the turkey in the pan and allow to cook for about two minutes on each side or until it is golden brown on all sides (you will have to peek inside the foil to check). Place the pan in the oven and cook for 15 minutes then flip the breasts and cook for an additional 20 to 30 minutes or until a probe thermometer inserted into the middle of the breast reads 165 degrees. Remove the pan from the oven and place the pan on a cutting board and allow to rest for five minutes. Remove the turkey from the foil then carve into 1  inch thick medallions</li><li>For the sauce:</li><li>Method: In a non-reactive saucepan bring the vinegar and the sugar to a boil. Cook the mixture till the sugar begins to caramelize (Brown). Add the Stock to the mixture quickly so that the caramel does not burn then add the hibiscus flowers to the pan and bring to a low boil. Allow the mixture to reduce by  then whisk in the cornstarch with the mixture still at a low boil. Season the sauce to taste with the salt then strain the sauce through a chinoix or fine sauce strainer.</li><li>To serve: Place a 1 oz. pool of the sauce on a plate and fan the carved turkey over the sauce.</li></ol>",
