    "instructions": "<ol><li>Method for the base:</li><li>Combine the crushed digestive biscuits with the melted butter and mix thoroughly.</li><li>Firmly press the mixture into a greased 10 inch springform tin.</li><li>Method for the filling:</li><li>Beat together all of the ingredients (excluding the blueberries) until it has thickened. Kurma suggests not to overmix this.</li><li>Pour  of the mixture on top of the crust and scatter on the blueberries. Pour the rest of the cheese mixture over the blueberries. This method protects the blueberries from burning in the oven and the flour they are dusted in will stop them from sinking to the bottom of the cheesecake during cooking.</li><li>Bake at 180 degrees Celsius for 1  hours until set (I left mine for 1 hour because my fan oven cooks things a little quicker).</li><li>Allow to cool and refrigerate for at least 8 hours.</li><li>Cut into (extra) large wedges and serve.</li></ol>",
