    "summary": "This recipe serves 4 and costs $1.24 per serving. Watching your figure? This caveman, gluten free, dairy free, and primal recipe has <b>201 calories</b>, <b>7g of protein</b>, and <b>19g of fat</b> per serving. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. It can be enjoyed any time, but it is especially good for <b>The Fourth Of July</b>. 9 people were impressed by this recipe. A mixture of chili pepper flakes, jumbo shrimp, extra virgin olive oil, and a handful of other ingredients are all it takes to make this recipe so delicious. All things considered, we decided this recipe <b>deserves a spoonacular score of 65%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/garlicky-herbed-shrimp-405385\">Garlicky Herbed Shrimp</a>, <a href=\"https://spoonacular.com/recipes/summer-herbed-grilled-shrimp-707633\">Summer Herbed Grilled Shrimp</a>, and <a href=\"https://spoonacular.com/recipes/grilled-shrimp-gyros-with-herbed-yogurt-spread-277044\">Grilled-Shrimp Gyros with Herbed Yogurt Spread</a> for similar recipes.",
