    "instructions": "<ol><li>Preheat oven to 325*.  Butter a loaf pan with a small amount of melted butter and lightly dust with flour.  Using the bowl of a Kitchen Aid mixer beat the eggs with the sugar on medium high until thick and light, about 5 minutes.  Add mashed bananas, buttermilk, honey, oil, vanilla, walnuts, remaining butter and chips.  Mix.</li><li>Mix together flours, baking powder, soda and salt.  Add dry mixture to wet ingredients and beat until just combined.  Transfer batter to loaf pan and bake about 1 hour.  Bread is done when a tester inserted in the center comes out clean.  Let bread sit for about 10 minutes; then turn bread out on a rack to finish cooling.</li></ol>",
