    "summary": "The recipe My \"Secret\" Bolognese Sauce can be made <b>in roughly roughly 45 minutes</b>. This sauce has <b>505 calories</b>, <b>29g of protein</b>, and <b>33g of fat</b> per serving. For <b>$2.76 per serving</b>, this recipe <b>covers 26%</b> of your daily requirements of vitamins and minerals. This recipe serves 12. It is a good option if you're following a <b>gluten free and dairy free</b> diet. This recipe from Foodista requires vidalian onions, granulated sugar, garlic cloves, and ground pork. 27 people were impressed by this recipe. All things considered, we decided this recipe <b>deserves a spoonacular score of 71%</b>. This score is good. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/the-secret-to-authentic-italian-bolognese-sauce-1039949\">The Secret to Authentic Italian Bolognese Sauce</a>, <a href=\"https://spoonacular.com/recipes/rag-alla-bolognese-bolognese-sauce-481414\">Ragù alla bolognese (Bolognese Sauce)</a>, and <a href=\"https://spoonacular.com/recipes/bolognese-sauce-ragu-bolognese-12250\">Bolognese Sauce (ragu Bolognese)</a>.",
