    "summary": "Apple Cheddar Turkey Burgers With Chipotle Yogurt Sauce might be just the main course you are searching for. This recipe makes 4 servings with <b>358 calories</b>, <b>38g of protein</b>, and <b>14g of fat</b> each. For <b>$2.68 per serving</b>, this recipe <b>covers 20%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up chipotle hot sauce, bread crumbs, sharp cheddar cheese, and a few other things to make it today. To use up the plain yogurt you could follow this main course with the <a href=\"https://spoonacular.com/recipes/5-minute-healthy-peach-frozen-yogurt-516109\">5-Minute Healthy Peach Frozen Yogurt</a> as a dessert. This recipe from Foodista has 37 fans. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 71%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/southwest-turkey-burgers-with-chipotle-yogurt-sauce-512497\">Southwest Turkey Burgers with Chipotle Yogurt Sauce</a>, <a href=\"https://spoonacular.com/recipes/honey-chipotle-cranberry-sauce-turkey-burgers-620503\">Honey Chipotle Cranberry Sauce (Turkey Burgers)</a>, and <a href=\"https://spoonacular.com/recipes/lamb-turkey-burgers-w-cucumber-yogurt-sauce-484717\">Lamb Turkey Burgers w/ Cucumber Yogurt Sauce</a> for similar recipes.",
