    "instructions": "<ol><li>Julienne red and yellow bell pepper, carrots, jicama and Thai basil into 1/8in thin and 2 inch long strips.</li><li>Fill a round pie pan or shallow plate with warm water. Dip one rice paper, making sure both sides are soaked. Lay on a flat flour towel cloth. Wait ten seconds for the paper to soft before using.</li><li>Peel rice paper off of cloth.</li><li>Place half of one butter leaf lettuce on top. Make sure to discard the ribbing.</li><li>Add a thin layer of each vegetable and finish with a few pieces of Thai Basil.</li><li>Starting at one end, fold the edge towards the middle. Repeat with parallel side. Rotate the spring roll by 90 degrees and roll form one end to the next.</li><li>Cut each roll diagonally and place facing up on a serving platter.</li><li>Garlic Lime Hoisin Sauce: Using a mortar and pestle crush garlic and ginger. Whisk in lime and Saracha. Add hoisin sauce and whisk to combine.</li></ol>",
