    "summary": "Shrimp and Avocado Salad might be a good recipe to expand your main course collection. One serving contains <b>502 calories</b>, <b>36g of protein</b>, and <b>23g of fat</b>. This recipe serves 4. For <b>$5.14 per serving</b>, this recipe <b>covers 38%</b> of your daily requirements of vitamins and minerals. A mixture of basil leaves, avocados into cubes, the salad, and a handful of other ingredients are all it takes to make this recipe so tasty. 7 people have tried and liked this recipe. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. It is brought to you by Foodista. It is a good option if you're following a <b>gluten free, dairy free, and pescatarian</b> diet. With a spoonacular <b>score of 86%</b>, this dish is amazing. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/shrimp-corn-california-avocado-pasta-salad-a-ca-avocado-trip-584558\">Shrimp, Corn & Californian Avocado Pasta Salad & a CAn Avocado Trip</a>, <a href=\"https://spoonacular.com/recipes/shrimp-and-avocado-salad-770494\">Shrimp and Avocado Salad</a>, and <a href=\"https://spoonacular.com/recipes/shrimp-and-avocado-salad-245506\">Shrimp and Avocado Salad</a>.",
