    "summary": "Crock-Pot: Asian-Style Country Ribs with Black Bean Garlic Sauce might be just the main course you are searching for. For <b>$5.39 per serving</b>, this recipe <b>covers 35%</b> of your daily requirements of vitamins and minerals. One serving contains <b>712 calories</b>, <b>67g of protein</b>, and <b>42g of fat</b>. Plenty of people made this recipe, and 912 would say it hit the spot. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. If you have coarsely cracked pepper, honey, soy salt, and a few other ingredients on hand, you can make it. To use up the honey you could follow this main course with the <a href=\"https://spoonacular.com/recipes/honey-gingerbread-133051\">Honey Gingerbread</a> as a dessert. It is a good option if you're following a <b>gluten free and dairy free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 93%</b>. This score is spectacular. Try <a href=\"https://spoonacular.com/recipes/crock-pot-bbq-country-style-ribs-484544\">Crock Pot BBQ Country Style Ribs</a>, <a href=\"https://spoonacular.com/recipes/asian-style-country-ribs-471442\">Asian Style Country Ribs</a>, and <a href=\"https://spoonacular.com/recipes/crock-pot-indonesian-style-country-ribs-114372\">Crock Pot Indonesian Style Country Ribs</a> for similar recipes.",
