    "summary": "Agave Glazed Carrots could be just the <b>gluten free and lacto ovo vegetarian</b> recipe you've been looking for. This recipe serves 4. For <b>36 cents per serving</b>, this recipe <b>covers 7%</b> of your daily requirements of vitamins and minerals. One serving contains <b>80 calories</b>, <b>1g of protein</b>, and <b>3g of fat</b>. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. It works well as an inexpensive side dish. <b>Easter</b> will be even more special with this recipe. 54 people found this recipe to be scrumptious and satisfying. It is brought to you by Foodista. If you have butter, salt and pepper, agave nectar, and a few other ingredients on hand, you can make it. With a spoonacular <b>score of 38%</b>, this dish is not so amazing. Similar recipes include <a href=\"https://spoonacular.com/recipes/agave-glazed-pork-belly-with-grilled-pineapple-155640\">Agave-Glazed Pork Belly with Grilled Pineapple</a>, <a href=\"https://spoonacular.com/recipes/agave-glazed-turkey-breast-with-sherry-gravy-138082\">Agave-Glazed Turkey Breast with Sherry Gravy</a>, and <a href=\"https://spoonacular.com/recipes/agave-chipotle-glazed-salmon-with-macadamia-cauliflower-rice-629416\">Agave Chipotle Glazed Salmon with Macadamia Cauliflower Rice</a>.",
