    "instructions": "<ol><li>If you are using frozen shrimp, remove them from the fridge and allow to come to room temperature before using.</li><li>Bring a large pot of water to a boil and cook your pasta according to package directions. 1 or 2 minutes before your pasta is done cooking, ladle about 250ml / 1 cup of the cooking water into a cup.</li><li>In the meantime, heat the olive oil in a large frying pan over medium heat. Add the shallots and garlic, season with salt and pepper, and saut until soft and translucent, about 3 to 5 minutes.</li><li>Add the wine and stir.</li><li>Add the tomatoes and simmer until the wine has evaporated, about 5 minutes.</li><li>Drain the pasta and add it to the sauce, along with the shrimp and cream, and toss to combine. If you find the sauce is too thick, add a splash of the pasta water.</li><li>Add the coriander and serve immediately.</li><li>Find more recipes on my blog http://alalemon.com</li></ol>",
