    "imageType": "jpg",
    "summary": "Grilled Peach Melba with Vanilla Bean Frozen Yogurt might be just the main course you are searching for. For <b>$4.0 per serving</b>, this recipe <b>covers 12%</b> of your daily requirements of vitamins and minerals. One serving contains <b>371 calories</b>, <b>17g of protein</b>, and <b>15g of fat</b>. 249 people have tried and liked this recipe. <b>The Fourth Of July</b> will be even more special with this recipe. It is a good option if you're following a <b>gluten free and vegetarian</b> diet. If you have coconut oil, raspberry fruit spread, greek yogurt, and a few other ingredients on hand, you can make it. To use up the coconut oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/dark-chocolate-raspberry-coconut-oatmeal-cookies-made-with-coconut-oil-809865\">Dark Chocolate Raspberry Coconut Oatmeal Cookies (made with coconut oil!)</a> as a dessert. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 49%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/vanilla-peach-swirl-frozen-yogurt-sundaysupper-489719\">Vanilla Peach Swirl Frozen Yogurt #SundaySupper</a>, <a href=\"https://spoonacular.com/recipes/vanilla-bean-frozen-yogurt-486904\">Vanilla Bean Frozen Yogurt</a>, and <a href=\"https://spoonacular.com/recipes/ginger-vanilla-bean-frozen-yogurt-605876\">Ginger Vanilla Bean Frozen Yogurt</a> for similar recipes.",
