    "summary": "Chicken Enchilada Chowder might be just the <b>Mexican</b> recipe you are searching for. This recipe serves 6. For <b>$2.24 per serving</b>, this recipe <b>covers 24%</b> of your daily requirements of vitamins and minerals. One portion of this dish contains roughly <b>30g of protein</b>, <b>18g of fat</b>, and a total of <b>484 calories</b>. A mixture of milk, cheddar cheese, cream of chicken soup, and a handful of other ingredients are all it takes to make this recipe so yummy. It works well as a reasonably priced main course. 6 people were impressed by this recipe. It is a good option if you're following a <b>gluten free</b> diet. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 60%</b>, which is good. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/chicken-and-cheese-enchilada-chowder-474567\">Chicken and Cheese Enchilada Chowder</a>, <a href=\"https://spoonacular.com/recipes/chipotle-chicken-enchilada-chowder-145404\">Chipotle Chicken Enchilada Chowder</a>, and <a href=\"https://spoonacular.com/recipes/chicken-and-cheese-enchilada-chowder-rewind-473949\">Chicken and Cheese Enchilada Chowder { Rewind}</a>.",
