    "summary": "Cod with tomatoes, olives and polenta might be just the main course you are searching for. One serving contains <b>368 calories</b>, <b>25g of protein</b>, and <b>19g of fat</b>. For <b>$3.35 per serving</b>, this recipe <b>covers 22%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 6 foodies and cooks. A mixture of tomatoes, an of oregano, parsley, and a handful of other ingredients are all it takes to make this recipe so scrumptious. To use up the dry white wine you could follow this main course with the <a href=\"https://spoonacular.com/recipes/white-wine-frozen-yogurt-206235\">White Wine Frozen Yogurt</a> as a dessert. It is a good option if you're following a <b>gluten free, dairy free, and pescatarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 87%</b>. This score is outstanding. Try <a href=\"https://spoonacular.com/recipes/roasted-cod-with-tomatoes-and-red-onion-927276\">Roasted Cod With Tomatoes and Red Onion</a>, <a href=\"https://spoonacular.com/recipes/polenta-with-fresh-tomatoes-and-parmesan-crisps-polenta-made-easy-196413\">Polenta with Fresh Tomatoes and Parmesan Crisps | Polenta Made Easy</a>, and <a href=\"https://spoonacular.com/recipes/creamy-polenta-with-mushrooms-chickpeas-and-olives-706650\">Creamy Polenta with Mushrooms, Chickpeas, and Olives</a> for similar recipes.",
