    "summary": "If you have roughly <b>roughly 45 minutes</b> to spend in the kitchen, Prosciutto Wrapped Broccolini With Basil Crisps might be an awesome <b>gluten free, dairy free, paleolithic, and primal</b> recipe to try. For <b>$7.54 per serving</b>, this recipe <b>covers 40%</b> of your daily requirements of vitamins and minerals. One portion of this dish contains roughly <b>146g of protein</b>, <b>21g of fat</b>, and a total of <b>878 calories</b>. This recipe serves 4. 8 people have tried and liked this recipe. If you have olive oil, basil, salt and pepper, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. With a spoonacular <b>score of 87%</b>, this dish is tremendous. <a href=\"https://spoonacular.com/recipes/prosciutto-wrapped-shrimp-with-mozzarella-and-basil-149340\">Prosciutto-Wrapped Shrimp with Mozzarellan and Basil</a>, <a href=\"https://spoonacular.com/recipes/pass-the-prosciutto-prosciutto-wrapped-pear-with-parmesan-551304\">pass the prosciutto – prosciutto wrapped pear with parmesan</a>, and <a href=\"https://spoonacular.com/recipes/caramelized-onion-prosciutto-and-broccolini-crustless-quiche-592959\">Caramelized Onion, Prosciutto and Broccolini Crustless Quiche</a> are very similar to this recipe.",
