    "summary": "Best Baked Macaroni and Cheese might be just the main course you are searching for. For <b>$1.76 per serving</b>, this recipe <b>covers 19%</b> of your daily requirements of vitamins and minerals. This recipe makes 12 servings with <b>577 calories</b>, <b>26g of protein</b>, and <b>32g of fat</b> each. 79 people have tried and liked this recipe. If you have flour, nutmeg, milk, and a few other ingredients on hand, you can make it. To use up the nutmeg you could follow this main course with the <a href=\"https://spoonacular.com/recipes/nutmeg-cake-600301\">Nutmeg Cake</a> as a dessert. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 63%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/macaroni-and-cheese-home-made-macaroni-and-cheese-is-a-comfort-food-that-is-hard-to-beat-you-can-put-away-the-pre-packaged-macaroni-and-cheese-at-the-store-600947\">Macaroni and Cheese – home made macaroni and cheese is a comfort food that is hard to beat. You can put away the pre packaged macaroni and cheese at the store</a>, <a href=\"https://spoonacular.com/recipes/baked-macaroni-and-cheese-633683\">Baked Macaroni and Cheese</a>, and <a href=\"https://spoonacular.com/recipes/baked-macaroni-and-cheese-338605\">Baked Macaroni and Cheese</a> for similar recipes.",
