    "summary": "Homemade King Ranch Chicken Casserole might be just the main course you are searching for. One serving contains <b>552 calories</b>, <b>35g of protein</b>, and <b>29g of fat</b>. For <b>$2.49 per serving</b>, this recipe <b>covers 22%</b> of your daily requirements of vitamins and minerals. 9362 people have tried and liked this recipe. If you have mexican cheddar jack cheese, chicken breasts, cream of chicken soup, and a few other ingredients on hand, you can make it. To use up the butter you could follow this main course with the <a href=\"https://spoonacular.com/recipes/cinnamon-butter-cake-60334\">Cinnamon Butter Cake</a> as a dessert. From preparation to the plate, this recipe takes roughly <b>1 hour and 5 minutes</b>. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 80%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/king-ranch-chicken-casserole-724274\">King Ranch Chicken Casserole</a>, <a href=\"https://spoonacular.com/recipes/king-ranch-chicken-casserole-492773\">King Ranch Chicken Casserole</a>, and <a href=\"https://spoonacular.com/recipes/king-ranch-chicken-casserole-182225\">King Ranch Chicken Casserole</a> for similar recipes.",
