    "summary": "One serving contains <b>863 calories</b>, <b>12g of protein</b>, and <b>63g of fat</b>. For <b>$2.1 per serving</b>, this recipe <b>covers 21%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 111 foodies and cooks. It can be enjoyed any time, but it is especially good for <b>Easter</b>. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. If you have cream cheese, vanillan extract, vegetable oil, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 64%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/classic-carrot-cake-with-cream-cheese-frosting-61463\">Classic Carrot Cake With Cream Cheese Frosting</a>, <a href=\"https://spoonacular.com/recipes/classic-carrot-cake-with-cream-cheese-frosting-612651\">Classic Carrot Cake with Cream Cheese Frosting</a>, and <a href=\"https://spoonacular.com/recipes/classic-carrot-cake-with-fluffy-cream-cheese-frosting-61433\">Classic Carrot Cake with Fluffy Cream Cheese Frosting</a> for similar recipes.",
